import React, { useState, useRef } from 'react';
import {
  View,
  Text,
  TextInput,
  TouchableOpacity,
  KeyboardAvoidingView,
  Platform,
  ScrollView,
} from 'react-native';
import { styles } from '../styles-part/LoginScreenStyles';
import SafeMitraLogo from '../../components/SafeMitraLogo';
import { Ionicons } from '@expo/vector-icons';

const LoginScreen = ({ navigation }) => {
  const [mobileNumber, setMobileNumber] = useState('');
  const [pin, setPin] = useState(['', '', '', '']);
  const pinInputRefs = useRef([...Array(4)].map(() => React.createRef()));

  const handleMobileNumberChange = (text) => {
    // Remove any non-digit characters
    const cleanNumber = text.replace(/[^0-9]/g, '');
    
    // Only take first 10 digits
    const truncatedNumber = cleanNumber.slice(0, 10);
    
    setMobileNumber(truncatedNumber);
  };

  const handlePinChange = (value, index) => {
    // Only allow digits
    if (!/^\d*$/.test(value)) {
      return;
    }

    const newPin = [...pin];
    newPin[index] = value;
    setPin(newPin);

    // Auto-focus next input
    if (value !== '') {
      if (index < 3) {
        pinInputRefs.current[index + 1].focus();
      }
    }
  };

  const handlePinKeyPress = (event, index) => {
    // Handle backspace
    if (event.nativeEvent.key === 'Backspace' && index > 0 && !pin[index]) {
      pinInputRefs.current[index - 1].focus();
      const newPin = [...pin];
      newPin[index - 1] = '';
      setPin(newPin);
    }
  };

  const handleLogin = () => {
    if (!mobileNumber || mobileNumber.length !== 10) {
      alert('Please enter a valid 10-digit mobile number');
      return;
    }

    if (pin.join('').length !== 4) {
      alert('Please enter complete PIN');
      return;
    }

    // Add login verification logic here
    // For now, just navigate to Voice Training
    navigation.navigate('VoiceTraining');
  };

  return (
    <KeyboardAvoidingView
      behavior={Platform.OS === 'ios' ? 'padding' : 'height'}
      style={styles.container}
    >
      <ScrollView contentContainerStyle={styles.scrollContainer}>
        <View style={styles.header}>
          <TouchableOpacity
            style={styles.backButton}
            onPress={() => navigation.goBack()}
          >
            <Ionicons name="arrow-back" size={24} color="#d32f2f" />
          </TouchableOpacity>
          <View style={styles.logoContainer}>
            <SafeMitraLogo color="#d32f2f" size={30} />
            <Text style={styles.logoText}>SafeMitra</Text>
          </View>
        </View>

        <View style={styles.formContainer}>
          <Text style={styles.title}>Secure Login</Text>
          <Text style={styles.subtitle}>
            Enter your mobile number and PIN
          </Text>

          <View style={styles.inputContainer}>
            <Text style={styles.label}>Mobile Number</Text>
            <View style={styles.mobileInput}>
              <TextInput
                style={styles.input}
                placeholder="Enter 10 digit mobile number"
                placeholderTextColor="#999"
                keyboardType="number-pad"
                value={mobileNumber}
                onChangeText={handleMobileNumberChange}
                maxLength={10}
              />
              <Ionicons name="call-outline" size={20} color="#999" style={styles.inputIcon} />
            </View>
          </View>

          <View style={styles.inputContainer}>
            <Text style={styles.label}>Enter PIN</Text>
            <View style={styles.pinContainer}>
              {pin.map((digit, index) => (
                <TextInput
                  key={index}
                  ref={el => pinInputRefs.current[index] = el}
                  style={styles.pinInput}
                  maxLength={1}
                  keyboardType="number-pad"
                  value={digit}
                  onChangeText={(value) => handlePinChange(value, index)}
                  onKeyPress={(event) => handlePinKeyPress(event, index)}
                  secureTextEntry
                />
              ))}
            </View>
          </View>

          <TouchableOpacity
            style={[
              styles.verifyButton,
              { opacity: mobileNumber.length === 10 && pin.join('').length === 4 ? 1 : 0.7 }
            ]}
            onPress={handleLogin}
            disabled={mobileNumber.length !== 10 || pin.join('').length !== 4}
          >
            <Text style={styles.verifyText}>
              Verify & Login
            </Text>
            <Ionicons name="arrow-forward" size={20} color="#FFF" />
          </TouchableOpacity>

          <View style={styles.securityContainer}>
            <Ionicons name="shield-checkmark" size={16} color="#999" />
            <Text style={styles.securityText}>
              Your login is encrypted and secure
            </Text>
          </View>

          <TouchableOpacity style={styles.supportButton}>
            <Text style={styles.supportText}>Need help? Contact Support</Text>
          </TouchableOpacity>
        </View>
      </ScrollView>
    </KeyboardAvoidingView>
  );
};

export default LoginScreen;
